import { StyleSheet } from 'react-native';

const styles = StyleSheet.create(
    {
    container: {
      flex: 1,
      backgroundColor: 'black',
    },
    card: {
        color: '#fcb300',
        fontFamily: 'Aachen'

    },
    buttonStyle: {
        backgroundColor: 'white',
        borderWidth: 2,
        borderColor: 'white',
        borderRadius: 30,
        justifyContent: 'center',
        alignItems: 'center',
        width: 200,
        marginHorizontal: 50,
        marginVertical: 2,     
    }
  }
)

  export default styles;
